    InputGroupAddon, Breadcrumb, BreadcrumbItem, ListGroup, ListGroupItem, Media
} from 'reactstrap';

import { useFormik } from 'formik';
import * as Yup from 'yup';
import Link from 'next/link';
import styles from './profile.module.scss';

import { Email, Phone, Person, Group, Accessibility, Alarm,
        Message, ArrowRight, ArrowDropDown, Home, Repeat, Close,
} from '@styled-icons/material';

import DashboardLayout from "../../layouts/DashboardLayout";
import Titlebar from "../../components/Titlebar";



export default function Chat() {
    return (


        <DashboardLayout>
            <React.Fragment>

                <Row noGutters xs="3">
                    <Col>

                    	<Media>

							<Media left href="#">

								<img src="/images/users/avatar-5.jpg" alt="Group thumbnail"
									style={{width: "50px", height:"50px",
											borderRadius:"50%", alignSelf:"flex-end",
											marginRight:"10px",
										}}/>

							</Media>

							<Media body>
								<div style={{display: "flex", justifyContend:"space-between"}}>
							        <h5 style={{fontSize:"16px", color:"white", display:"inline-block"}}>
							          Media heading
							        </h5>
									<span style={{fontSize: "11px",
													marginRight:"20px",
													alignSelf: "flex-end"
												}}>

													1:00pm
									</span>
								</div>
						        Donec lacinia congue felis in faucibus.
						    </Media>
                    	</Media>

                    </Col>


                    <Col lg="8">

                       <Alert color="info"> chat box </Alert>

                    </Col>


                    <Col>

                       <Alert color="info"> profile dynamic</Alert>

                    </Col>


                </Row>




            </React.Fragment>

        </DashboardLayout>

    )
}
